import { Drawer, IconButton } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

interface LeftDrawerProps {
  open: boolean;
}

export default function LeftDrawer({ open }: LeftDrawerProps) {
  return (
    <Drawer
      anchor="left"
      open={open}
      variant="persistent"
      classes={{
        paper: "custom-drawer-paper",
      }}
    >
      <div style={{ width: "30%" }}>
        <IconButton>
          <MenuIcon />
        </IconButton>
        <h1>Menu</h1>
      </div>
    </Drawer>
  );
}
